import React from 'react';

function Home(props) {
    return(
        <Jumbotron>
            <div class="container d-flex h-100">
                <div class="row justify-content-center align-self-center w-100">
                    <Fade in>
                        <div className="col-12 text-center noselect">
                            <p className="jumbotron-subtitle jumbotron-title-font">Full Stack Developer</p>
                            <h1 className="display-4">
                                <span className="border-3 px-3 jumbotron-title-font super-bold">Lawrence McDaniel</span>
                            </h1>
                            <p className="jumbotron-subtitle jumbotron-title-font">Open edX Enthusiast</p>
                        </div>
                    </Fade>
                </div>
            </div>                    
        </Jumbotron>
    );
}


function RenderPageTitle(props) {

    const thisClassName = "fa " + props.icon + " fa-2x page-tile-icon";

    return(

        <div className="row">
            <div className="col-12 text-center page-title">
                <span className={thisClassName}></span>
                <h1 className="display-4">{props.title} <span className="page-title-boxed">{props.boxed_title}</span></h1>
            </div>                
        </div>

    );
}

export default RenderPageTitle;
